import React from "react";
import { StyleSheet, Image, Text, View, ImageBackground } from "react-native";

export default function PersonCard({
  name,
  image,
  rating,
  ratingcount,
  address,
}) {
  return (
    <View style={styles.ThemeLightComponentSongsCard}>
      <Image
        style={styles.MaskGroup}
        source={{
          uri: image,
          headers: {
            Accept: "*/*",
          },
        }}
      />
      <View style={styles.AutoLayoutVertical}>
        <Text style={styles.Txt758}>{name}</Text>
        <Text style={styles.multiple1}>
          ★ {rating}
          {ratingcount} · {address} · Technician
        </Text>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  ThemeLightComponentSongsCard: {
    display: "flex",
    flexDirection: "row",
    justifyContent: "flex-start",
    alignItems: "center",
    paddingTop: 7,
    paddingBottom: 7,
    paddingLeft: 15,
    paddingRight: 15,
    backgroundColor: "rgba(255, 255, 255, 1)",
    width: 426,
    height: 96,
  },
  MaskGroup: {
    width: 80,
    height: 80,
    marginRight: 16,
    borderRadius: 20,
  },
  AutoLayoutVertical: {
    display: "flex",
    flexDirection: "column",
    justifyContent: "flex-start",
    alignItems: "flex-start",
    flex: 1,
    width: 298,
  },
  Txt758: {
    fontSize: 18,
    // fontFamily: "Urbanist, sans-serif",
    fontWeight: "400",
    lineHeight: 18,
    color: "rgba(33,33,33,1)",
    width: 299,
    marginBottom: 10,
  },
  multiple1: {
    main: "Txt884",
    seg1: "[object Object]",
    seg2: "[object Object]",
    seg3: "[object Object]",
    seg4: "[object Object]",
    seg5: "[object Object]",
    seg6: "[object Object]",
    seg7: "[object Object]",
  },
});
